INSERT INTO `tbl_emailtemplates` (`id`, `static_email_heading`, `title`, `subject`, `template`) VALUES
(1, 'admin_forgot', 'Admin Forgot Password', 'Admin Forgot Password', '<tr>\n                    <td style=\"color:#000000; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\"><b style=\"color:#000000;\">Dear</b> Admin,</td>\n                </tr>\n                <tr>\n                    <td style=\"color:#434343; font-size:13px; line-height:18px;\">\n                        <p style=\"color:#434343;margin:10px 0 0;\">You have successfully retrieved login credentials!</p>\n                        <p style=\"color:#434343;margin:10px 0 0;\"><strong style=\"width:150px;\">Email Address:</strong> [!email!]</p>\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Username:</strong> [!username!]</p>\n                        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Password:</strong> [!password!]</p>  \n                        <p style=\"color:#434343;margin:10px 0 0;\"><a href=\"[!HTTP_PATH!]/admin/admins/login\" style=\"color:#434343;\">Click here</a> to login.</p>\n                        \n                    </td>\n                </tr>'),
(2, 'user_register', 'User Registration', 'Welcome to [!SITE_TITLE!]', '<tr>\r\n    <td style=\"color:#000000; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\"><b style=\"color:#000000;\">Dear</b> [!username!],</td>\r\n</tr>\r\n<tr>\r\n    <td style=\"color:#434343; font-size:13px; line-height:18px;\">\r\n          <p style=\"color:#434343; margin:0px 0 0;\">We are pleased to announce that your account has been created successfully.</p>\r\n        <p style=\"color:#434343; margin:10px 0 0;\"><strong style=\"width:150px;\">Company Name:</strong> [!company_name!]</p>\r\n        <p style=\"color:#434343; margin:0px 0 0;\"><strong style=\"width:150px;\">Email Address:</strong> [!email!]</p>\r\n        <p style=\"color:#434343; margin:0px 0 0;\"><strong style=\"width:150px;\">Password:</strong> [!password!]</p>    \r\n        <p style=\"color:#434343; margin:10px 0 0;\">Please click the link below to verify your Email address. </p>\r\n        <p style=\"color:#434343; margin:0px 0 0;\"><a style=\"text-decoration:underline;\" href=\"[!LINK!]\">Click here</a> to verify your Email address. </p>\r\n\r\n    </td>\r\n</tr>\r\n'),
(3, 'forgot_password', 'Forgot Password', 'Stafir Reset password', '<tr>\r\n    <td style=\"color:#000000; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\"><b style=\"color:#000000;\">Dear</b> [!username!],</td>\r\n</tr>\r\n<tr>\r\n    <td style=\"color:#434343; font-size:13px; line-height:18px;\">\r\n        <p style=\"color:#434343;margin:10px 0 0;\">Please reset Password on <a href=\"<?php echo HTTP_PATH;?>\" style=\"color:#eb2f23;text-decoration: underline;\"></a> [!SITE_TITLE!].</p>\r\n        <p style=\"color:#434343;margin:10px 0 0;\"><a href=\"[!LINK!]\" style=\"color:#434343; \">Click here</a> to reset your account password.</p>\r\n    </td>\r\n</tr>'),
(4, 'admin_user_register', 'Company Registration', 'Your Company has been registered by Admin', '<tr>\r\n    <td style=\"color:#000000; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\"><b style=\"color:#000000;\">Dear</b> [!username!],</td>\r\n</tr>\r\n<tr>\r\n    <td style=\"color:#434343; font-size:13px; line-height:18px;\">\r\n        <p style=\"color:#434343;margin:10px 0 0;\">Welcome to</b> [!SITE_TITLE!]</p>\r\n        <p style=\"color:#434343; margin:0px 0 0;\">We are pleased to announce that your account has been created successfully by Admin.</p>\r\n        <p style=\"color:#434343; margin:10px 0 0;\"><strong style=\"width:150px;\">Company Name:</strong> [!company_name!]</p>\r\n        <p style=\"color:#434343; margin:0px 0 0;\"><strong style=\"width:150px;\">Email Address:</strong> [!email!]</p>\r\n        <p style=\"color:#434343; margin:0px 0 0;\"><strong style=\"width:150px;\">Password:</strong> [!password!]</p>\r\n\r\n    </td>\r\n</tr>'),
(5, 'admin_three_times', 'Stafir Password Assistance', 'Stafir Password Assistance', '<tr>\r\n    <td style=\"color:#000000; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\"><b style=\"color:#000000;\">Dear</b> Admin,</td>\r\n</tr>\r\n<tr>\r\n    <td style=\"color:#434343; font-size:13px; line-height:18px;\">\r\n        <p style=\"color:#434343;margin:10px 0 0;\">Some one trying more than 3 unsuccessful login attempts. To prevent unauthenticated access by anyone, here is new login credential :</p>\r\n        <p style=\"color:#434343;margin:10px 0 0;\"><strong style=\"width:150px;\">Email Address:</strong> [!email!]</p>\r\n        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Username:</strong> [!username!]</p>\r\n        <p style=\"color:#434343;margin:0px 0 0;\"><strong style=\"width:150px;\">Password:</strong> [!password!]</p>  \r\n        <p style=\"color:#434343;margin:10px 0 0;\"><a href=\"[!HTTP_PATH!]/admin/admins/login\" style=\"color:#434343;\">Click here</a> to login.</p>\r\n\r\n    </td>\r\n</tr>'),
(6, 'company_contact_us', 'Contact Us', 'Contact Us', '<tr>\r\n                    <td style=\"color:#000000; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\">Dear [!chairman!],</td>\r\n                </tr>\r\n                <tr>\r\n                    <td style=\"color:#434343; font-size:13px; line-height:18px;\">\r\n                        <p style=\"color:#434343; margin:10px 0 0;\">An user on [!SITE_TITLE!] has sent an inquiry. Below are the details!</p>\r\n                        <p style=\"color:#434343; margin:10px 0 0;\"><strong style=\"width:150px;\">Name:</strong> [!username!]</p>\r\n                        <p style=\"color:#434343; margin:10px 0 0;\"><strong style=\"width:150px;\">Email Address:</strong> [!email!]</p>   \r\n       <p style=\"color:#434343; margin:10px 0 0;\"><strong style=\"width:150px;\">Subject:</strong> [!sbj!]</p> \r\n                        <p style=\"color:#434343; margin:10px 0 0;\"><strong style=\"width:150px;\">Message:</strong> [!message!]</p>              \r\n                    </td>\r\n                </tr>'),
(7, 'company_contact_to_user', 'Your Enquiry has been submitted on [!SITE_TITLE!]', 'Your Enquiry has been submitted on [!SITE_TITLE!]', '<tr>\r\n            <td valign=\"top\">\r\n                 <table width=\"100%\">\r\n                    <tbody>\r\n                        <tr>\r\n                            <td style=\"color:#000000; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;\">Dear</span> [!username!],</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td style=\"color:#434343; font-size:13px; line-height:18px;\">\r\n                                <p style=\"color:#434343; margin:10px 0 0;\">Your enquiry has been submitted on <span style=\"color:#434343;\">[!SITE_TITLE!]</span>. We will get back to you soon.</p>\r\n                                <p style=\"color:#434343; margin:10px 0 0;\"><strong style=\"width:150px;\">Name:</strong> [!username!]</p>\r\n                                <p style=\"color:#434343; margin:10px 0 0;\"><strong style=\"width:150px;\">Email Address: </strong> [!email!]</p> \r\n<p style=\"color:#434343; margin:10px 0 0;\"><strong style=\"width:150px;\">Subject:</strong> [!sbj!]</p>  \r\n                                <p style=\"color:#434343; margin:10px 0 0;\"><strong style=\"width:150px;\">Message:</strong> [!message!]</p>\r\n\r\n                            </td>\r\n                        </tr>\r\n                     \r\n                    </tbody></table>\r\n            </td>\r\n        </tr>');
