(1, 1, 'HRC Fuse & Base', 23, 774, 26.00, 0, 'Length', 'Inches', 1.00, '12', '', '<p><span class=\"_Tgc\"><strong>HRC Fuse</strong> or High Rupturing Capacity <strong>Fuse</strong>. <strong>HRC fuse</strong> or high rupturing capacity <strong>fuse</strong>- In that type of <strong>fuse</strong>, the <strong>fuse</strong> wire or element can carry short circuit heavy current for a known time period. During this time if the fault is removed, then it does not blow off otherwise it blows off or melts.</span></p>', 'hrc-fuse-base', 1, '2016-09-06 11:33:41', '2016-09-06 11:34:37'),
(2, 4, 'Brick', 21, 812, 250.56, 1, 'Length', 'Feet', 5.00, '20', '', '<p><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 13px; line-height: 16.12px;\"><u><strong>A brick</strong>&nbsp;: &nbsp;</u>is building material used to make walls, pavements and other elements in masonry construction. Traditionally, the term brick referred to a unit composed of clay, but it is now used to denote any rectangular units laid in mortar.</span><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 13px; line-height: 16.12px;\">A brick is building material used to make walls, pavements and other elements in masonry construction. Traditionally, the term brick referred to a unit composed of clay, but it is now used to denote any rectangular units laid in mortar.</span></p>\r\n<div><span style=\"color: #222222; font-family: arial,sans-serif;\"><span style=\"font-size: 13px; line-height: 16.12px;\"><br /></span></span>\r\n<div><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 13px; line-height: 16.12px;\"><strong>A brick is building material used to make walls, pavements and other elements in masonry construction. Traditionally, the term brick referred to a unit composed of clay, but it is now used to denote any rectangular units laid in mortar.</strong></span></div>\r\n</div>\r\n<div><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 13px; line-height: 16.12px;\">&nbsp;</span></div>', 'brick', 1, '2016-09-07 12:22:36', '2016-09-07 13:21:37'),
