INSERT INTO `tbl_products` (`id`, `user_id`, `name`, `category_id`, `subcategory_id`, `price`, `unit_type`, `unit_of_measure`, `unit_value`, `delivery_cost`, `minimum_orders`, `completed_orders`, `description`, `slug`, `status`, `created`, `modified`) VALUES
(9, 9, 'Antlers', 15, 1056, 10.00, 0, '', '', 20.00, '1000', '', '\r\n                            \r\n                            <h2>Everyone hates paying bank fees. But imagine paying fees on a ghost account you didn\'t even sign up for.</h2> <p> That\'s exactly what happened to Wells Fargo customers nationwide. </p> <div id=\"ie_column\"> \r\n </div> <p> On Thursday, federal regulators said Wells Fargo employees \r\nsecretly created millions of unauthorized bank and credit card accounts \r\n-- without their customers knowing it -- since 2011. </p><div id=\"smartassetcontainer\" class=\"module\" style=\"float:none; width: 300px; margin-bottom:0;\"><div class=\"module\" style=\"height:35px; margin-bottom:0;\"><div class=\"module-body\" style=\"padding-top:0;\"><div style=\"float: left; margin-right: 20px; margin-bottom: 25px;\" id=\"smartasset-article\" class=\"collapsible\">\r\n\r\n\r\n\r\n\r\n         <div class=\"cnnhdr\">\r\n        Powered by SmartAsset.com\r\n    </div>\r\n    \r\n<iframe style=\"overflow: hidden; width: 300px; height: 620px;\" id=\"sa_0CbVvsjWKlYW\" class=\"sa-iframe\" src=\"https://smartasset.com/embed/mortgageratesc?&amp;key=bdknf2rinbhwvdksm6zbmhf3twrv4oih&amp;src=http%253A%252F%252Fmoney.cnn.com%252F2016%252F09%252F08%252Finvesting%252Fwells-fargo-created-phony-accounts-bank-fees%252Findex.html&amp;ref=http%253A%252F%252Fedition.cnn.com%252F&amp;ver=1.1&amp;rnd=qnttcoft\" scrolling=\"no\"></iframe>\r\n\r\n     <div id=\"sa_0CbVvsjWKlYW-img\">\r\n        <a href=\"https://smartasset.com/mortgage/mortgage-rates?utm_source=captivate&amp;utm_medium=referral&amp;utm_campaign=cap__mortgageratesc\" target=\"_blank\">MORTGAGE RATES BY</a>\r\n        <a href=\"http://money.cnn.com/2016/09/08/investing/wells-fargo-created-phony-accounts-bank-fees/index.html#\"><img src=\"https://dr5dymrsxhdzh.cloudfront.net/files/1/images/calculator-by-smartasset2.png\" alt=\"MORTGAGE RATES BY\"></a>\r\n    </div>\r\n\r\n</div></div></div></div> <p> The phony accounts earned the bank \r\nunwarranted fees and allowed Wells Fargo employees to boost their sales \r\nfigures and make more money. </p> <p> \"Wells Fargo employees secretly \r\nopened unauthorized accounts to hit sales targets and receive bonuses,\" \r\nRichard Cordray, director of the Consumer Financial Protection Bureau, \r\nsaid in a statement. </p> <p> Wells Fargo confirmed to CNNMoney that it \r\nhad fired 5,300 employees related to the shady behavior. Employees went \r\nto far as to create phony PIN numbers and fake email addresses to enroll\r\n customers in online banking services, the CFPB said. </p> <p> <a href=\"http://money.cnn.com/2016/01/14/investing/atm-overdraft-fees/index.html?iid=EL\"><span class=\"inStoryHeading\">Related: ATM and overdraft fees top $6 billion at the big 3 banks</span></a> </p> <p>\r\n The scope of the scandal is shocking. An analysis conducted by a \r\nconsulting firm hired by Wells Fargo concluded that bank employees \r\nopened up over 1.5 million deposit accounts that may not have been \r\nauthorized, according to the CFPB. </p> <p> The way it worked was that \r\nemployees moved funds from customers\' existing accounts into \r\nnewly-created accounts without their knowledge or consent, regulators \r\nsay. The CFPB described this practice as \"widespread\" and led to \r\ncustomers being charged for insufficient funds or overdraft fees -- \r\nbecause the money was not in their original accounts.&nbsp;</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><img src=\"data:image/jpeg;base64,', 'antlers', 1, '2016-09-09 00:53:27', '2017-01-28 13:10:38');
