(16, 9, 0, 'There is now a timetable for Brexit.\r\n\r\nBritish Prime Minister Theresa May said on Sunday that the U.K. would begin the formal process of leaving the European Union by the end of March 2017. That means Brexit could happen in 2019.\r\n\r\nSpeaking on the BBC\'s Andrew Marr Show, May said: \"The people have spoken; we will deliver on that.\"\r\n\r\nBritain would trigger Article 50 of the EU treaty in the first quarter of next year, she said. That act will start the clock on two years of exit negotiations with the other 27 members of the group.', 4, 60, 0, 0, '', '', 0, NULL, '', 0.00, 'acee3_factory-008.jpg', 1, '201610020700279108', '2016-10-02 07:00:27', '2016-10-02 07:00:27'),
(17, 9, 0, 'Police in Germany are hunting a 22-year-old Syrian man in connection with a suspected planned bomb attack, Saxony Police told CNN on Saturday.\r\nHe was named by police as Jaber Albakr. He was born Jan. 10, 1994 and is from the Damascus countryside, police said.', 6, 123, 0, 0, '', '', 0, NULL, '', 0.00, 'c1657_beauty-nature-reflections-wallpaper-high-quality-bk1vfmp010.jpg', 1, '201610080459409961', '2016-10-08 16:59:40', '2016-10-08 16:59:40'),
(18, 9, 0, 'The country maintains a combination of market economy and a Nordic welfare model with universal health care and a comprehensive social security system. Norway has extensive reserves of petroleum, natural gas, minerals, lumber, seafood, fresh water, and hydropower. The petroleum industry accounts for around a quarter of the country\'s gross domestic product (GDP).[17] On a per-capita basis, Norway is the world\'s largest producer of oil and natural gas outside the Middle East.[18][19]\r\n\r\nThe country has the fourth-highest per capita income in the world on the World Bank and IMF lists.[20] On the CIA\'s GDP (PPP) per capita list (2015 estimate) which includes territories and some regions, Norway ranks as number eleven.[21] From 2001 to 2006,[22] and then again from 2009 to 2015, Norway had the highest Human Development Index ranking in the world.[13][23][24][25] Norway has topped the Legatum Prosperity Index for seven years in a row as of 2015.[26] Norway ranks also first on the OECD Better Life Index, the Index of Public Integrity, and the Democracy Index.[27]', 5, 69, 0, 0, '', '', 0, NULL, '', 0.00, 'b274f_norway-landscape-photography-scandinavian-nature-4.jpg', 1, '201610140339369828', '2016-10-14 03:39:36', '2016-10-14 03:39:36'),
(19, 9, 0, 'CRUNCH is a use case heavy conference for people interested in building the finest data driven businesses. No matter the size of your venture or your job description you will find exactly what you need on the two-track CRUNCH conference. A data engineering and a data analytics track will serve diverse business needs and levels of expertise.\r\nWorkshop day: October 5\r\nConference days: October 6-7\r\n\r\nIf you are a Data Engineer, Data Scientist, Product Manager or simply interested how to utilise data to develop your business, this conference is for you. No matter the size of your company or the volume of your data, come and learn from the Biggest players of Big Data, get inspiration from their practices, from their successes and failures and network with other professionals like you.', 5, 86, 0, 0, '', '', 0, NULL, '', 0.00, '2dd13_osoyoos-spirit-ridge-meeting-04.jpeg', 1, '201611230432259393', '2016-11-23 16:32:25', '2016-11-23 16:32:25'),
